    public function testDistanceForAnswers2Code1TextDiff()
    {
        $answers1 = [ 
            "" => [
                "moa" => ["b" => "mua"],
                "pe" => ["b" => "pi"],
                "roado" => ["d" => "ruato"],
                "ver" => ["d" => "vir"],
                "ele" => ["e" => "ely"],
                "ostoa" => ["c" => "otua"]
            ]
        ];
        
        $answers2 = [
            "" => [
                "moa" => ["b" => "mua"],
                "pe" => ["e" => "pie"],
                "roado" => ["d" => "ruado"],
                "ver" => ["d" => "vir"],
                "ele" => ["d" => "eli"],
                "ostoa" => ["c" => "otua"]
            ]
        ];
        $normalize = false;
        $weights = [
            "" => [
                "moa" => 1,
                "pe" => 1,
                "roado" => 1,
                "ver" => 1,
                "ele" => 2,
                "ostoa" => 2]
        ];
        $result = Clusterization::distanceForAnswers($answers1, $answers2, $normalize, $weights);
        
        $expected = 3;
        $this->assertEquals( $expected, $result);        
    }
    
